import {React,  useState } from "react";
import { useNavigate} from "react-router-dom";
import "../style/login.css";
import { auth } from "../services/firebase";
import { signInWithEmailAndPassword, GoogleAuthProvider, signInWithPopup,  fetchSignInMethodsForEmail,   linkWithCredential } from "firebase/auth";
import { LoginPopup } from "../modal/LoginPopup";

function Login() {
  const navigate = useNavigate();
  const [popupMessage, setPopupMessage] = useState("");
  const [popupType, setPopupType] = useState("info");

 const handleLogin = async (e) => {
    e.preventDefault();
    const email = e.target.email.value;
    const password = e.target.password.value;

    try {
      const userCredential = await signInWithEmailAndPassword(auth, email, password);
      const user = userCredential.user;

      setPopupType("success");
      setPopupMessage("Login successful!");
      setTimeout(() => navigate("/dashboard"), 1000);

    } catch (error) {
      console.error(error);
      setPopupType("error");
      setPopupMessage("Login failed. Unsuccessful authentication");
    }
  };


 const handleGoogleLogin = async () => {
  const provider = new GoogleAuthProvider();

  try {
    const result = await signInWithPopup(auth, provider);
    const user = result.user;

    // Convert email to a valid Realtime DB key (replace "." with ",")
    const emailKey = user.email.replace(/\./g, ",");

    const db = getDatabase();
    const userRef = ref(db, `authentication/${emailKey}`);
    const snapshot = await get(userRef);

    if (snapshot.exists()) {
      // Email exists in Realtime Database → allow login
      alert(`Login successful: ${user.email}`);
      // navigate("/dashboard"); // Uncomment if using react-router
    } else {
      // Email not found → deny login
      alert(`This Google account is not registered.`);
      await auth.signOut(); // log out Google session
    }

  } catch (error) {
    console.error(error);
    alert("Google login failed: " + error.message);
  }
};


  return (
    <div className="login-container">
      <div className="card">
        <div className="text-center mb-3">
          <img
            src="/images/laundrylogo.jpg"
            alt="Lola Fe's Laundry PH Logo"
            className="img-fluid"
          />
        </div>

        <h3 className="text-center">Welcome to Lola Fe's Laundry PH</h3>
        <p className="text-center">Sign in to continue</p>

        {/* Google Login */}
        <button className="btn-google" onClick={handleGoogleLogin}>
          <img
            src="https://www.gstatic.com/firebasejs/ui/2.0.0/images/auth/google.svg"
            alt="Google Logo"
          />
          Continue with Google
        </button>

        <div className="d-flex align-items-center">
          <hr className="divider flex-grow-1" />
          <span className="divider-text">OR</span>
          <hr className="divider flex-grow-1" />
        </div>

        <form onSubmit={handleLogin}>
          <div className="mb-3 text-start">
            <label htmlFor="email" className="form-label">Email</label>
            <input type="email" id="email" className="form-control" placeholder="you@example.com" required />
          </div>

          <div className="mb-3 text-start">
            <label htmlFor="password" className="form-label">Password</label>
            <input type="password" id="password" className="form-control" placeholder="********" required />
          </div>

          <button type="submit" className="btn-primary">
            Sign in
          </button>
        </form>

        <div className="footer-links mt-4">
          <a href="#">Forgot password?</a>
          <a href="#">Sign up</a>
        </div>
      </div>

      <LoginPopup
        message={popupMessage}
        type={popupType}
        onClose={() => setPopupMessage("")}
      />
    </div>
  );
}

export default Login;
